'mail/chrome/messenger/aboutRights.dtd:rights.webservices-term5' => '&amp;vendorShortName; може при необхідності оновлювати ці умови час від часу. Ці умови не можуть бути змінені чи скасовані без письмової згоди &amp;vendorShortName;.',
'mail/chrome/messenger/aboutRights.dtd:rights.webservices-term4' => 'Окрім випадків, зазначених у законі, &amp;vendorShortName; його учасники, ліцензіари та дистриб’ютори не відповідають за непрямі, особливі, випадкові, крані, послідовні чи зразкові збитки, що випливають з чи якимось чином пов’язані з використанням &amp;brandShortName; та Послуг. Колективна відповідальність за цих умов не буде перевищувати $500 (п’ятсот доларів США). Деякі юрисдикції не дозволяють виключення чи обмеження деяких збитків, тож ці обмеження чи винятки можуть вас не стосуватися.',
